searchForEvent.getEventsMonth().as("month").children().first().then(function (option) {
  cy.get("@month").select(option.text());
});
searchForEvent.getUpdateResultsButton().click();
cy.get("body").then(function (body) {
  if (body.find(".search-for-events-no-results").length > 0) {
    cy.get(".search-for-events-no-results").should("include.text", "Sorry your search has not found any events, try a different type, location or month.");
  } else {
    eventSignup.getSearchedEventName().first().then(function (eventName) {
      cy.contains(eventName.text().trim()).click();
      eventSignup.getSignupForThisEventButton().click();
      eventSignup.getEventNameHeader().should("have.text", eventName.text().trim());
      eventSignup.getNextStep().click();
      cy.contains("Enter your full email address").should(function (el) {
        expect(el).to.have.attr("href", "#events-steps-personal-details-email-field-error");
      }).click().type("Test_email@gmail.com");
      eventSignup.getNextStep().click();
      cy.get(".govuk-list.govuk-error-summary__list > li:nth-child(1)").should("have.text", "Enter your first name").next().should("have.text", "Enter your last name");
      cy.contains("Enter your first name").should(function (el) {
        expect(el).to.have.attr("href", "#events-steps-personal-details-first-name-field-error");
      }).click().type("Test_First_Name");
      eventSignup.getNextStep().click();
      cy.get(".govuk-list.govuk-error-summary__list > li:nth-child(1)").should("have.text", "Enter your last name");
      cy.contains("Enter your last name").should(function (el) {
        expect(el).to.have.attr("href", "#events-steps-personal-details-last-name-field-error");
      }).click().type("Test_Last_Name");
      eventSignup.getNextStep().click();
    });
    cy.get(".govuk-back-link").should("exist").should("have.text", "Back");
  }
});

